import React from 'react';
import './App.css';
import Card from './Card/Card';
import GraphicCard from './GraphicCard/GraphicCard';
import Home from './Home/Home';


class App extends React.Component{
  render(){
    return(
      <Card>
        <div className="overlay"></div>
        <GraphicCard/>
        <Home/>
      </Card>
    )
  }
}

export default App;
